" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Phenylephrine and zinc sulfate: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?24/14/24804?source=see_link\">",
"    see \"Phenylephrine and zinc sulfate: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list cbnlist drugH1Div drugBrandNames\" id=\"F209438\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: Canada",
"    </span>",
"    <ul>",
"     <li>",
"      Zincfrin&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F209443\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Adrenergic Agonist Agent",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F209439\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Ocular irritation:",
"     </b>",
"     Ophthalmic: Instill 1-2 drops in eye(s) 2-4 times/day as needed",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F209440\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foccan drugH1Div\" id=\"F10134271\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: Canada",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Solution, ophthalmic:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Zincfrin&reg;: Phenylephrine 0.12% and zinc sulfate 0.25% (15 mL) [not available in the U.S.]",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11234246\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Not available in U.S.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F209431\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Soothe, moisturize, and remove redness due to minor eye irritation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F209434\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to phenylephrine, zinc sulfate, or any component of the formulation",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13299873\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F209428\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Alpha1-Blockers: May diminish the hypertensive effect of Alpha1-Agonists. Similarly, Alpha1-Agonists may antagonize hypotensive effects of Alpha1-Blockers. Alpha1-Blockers may diminish the vasoconstricting effect of Alpha1-Agonists. Similarly, Alpha1-Agonists may antagonize Alpha1-Blocker vasodilation.",
"     <i>",
"      Risk C: Monitor therapy",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     AtoMOXetine: May enhance the hypertensive effect of Sympathomimetics. AtoMOXetine may enhance the tachycardic effect of Sympathomimetics.",
"     <i>",
"      Risk C: Monitor therapy",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Cannabinoids: May enhance the tachycardic effect of Sympathomimetics.",
"     <i>",
"      Risk C: Monitor therapy",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Ergot Derivatives: May enhance the hypertensive effect of Alpha1-Agonists. Ergot Derivatives may enhance the vasoconstricting effect of Alpha1-Agonists.",
"     <b>",
"      Exceptions:",
"     </b>",
"     Ergoloid Mesylates.",
"     <i>",
"      Risk X: Avoid combination",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Iobenguane I 123: Sympathomimetics may diminish the therapeutic effect of Iobenguane I 123.",
"     <i>",
"      Risk X: Avoid combination",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     MAO Inhibitors: May enhance the hypertensive effect of Alpha1-Agonists.",
"     <i>",
"      Risk X: Avoid combination",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Sympathomimetics: May enhance the adverse/toxic effect of other Sympathomimetics.",
"     <i>",
"      Risk C: Monitor therapy",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Tricyclic Antidepressants: May enhance the vasopressor effect of Alpha1-Agonists.",
"     <i>",
"      Risk D: Consider therapy modification",
"     </i>",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F209435\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Exastrin (MX);",
"     </li>",
"     <li>",
"      Zincfrin (AU, BE, CO, DK, FI, GR, NZ, PK, SE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F209433\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     See individual agents.",
"    </p>",
"   </div>",
"  </div>",
