" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 542px\">",
"   <div class=\"ttl\">",
"    Cytomegalovirus pneumonitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 522px; height: 477px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A, B) High-resolution computed tomography images (1.0 mm collimation) at the levels of the azygos arch (A) and bronchus intermedius (B) show bilateral ground-glass opacities and poorly defined small nodules (arrows). A small right pleural effusion is also present.",
"    <br>",
"     (C) Photomicrograph of a biopsy specimen shows a moderate degree of interstitial fibrosis and chronic inflammation (white arrow) as well as plugs of fibroblastic tissue in the lumens of several airspaces (black arrows).",
"     <br>",
"      (D) Highly magnified photomicrograph shows several large cells containing intranuclear inclusions consistent with cytomegalovirus (black arrows). (Compare size with hyperplastic type 2 pneumocytes [white arrow].) The patient was a 28-year-old man with acute myelogenous leukemia.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
